import logo from './logo.svg';
import './App.css';

import Home from "./pages/Home";

function App() {
  return (
    <div class="page-wraper">
      <Home />
      <a href="index.html" class="dez-page"><img src="{logo}" alt="BRAND NAME" /></a>
    </div>
  );
}

export default App;
